import {Paper, Card , Typography , makeStyles} from '@material-ui/core'

export default function PageHeader(props) {
    const { title , icon } = props
    return (
        <Paper elevation={0} square >
       <div>
            <Card>
                {icon}
            </Card>
        </div>
        <div>
            <Typography variant="h6" component="div">{title}
            </Typography>
        </div>


        </Paper>





    )
}
